import { Link } from 'react-router-dom';
import classes from "./MainNavigation.module.css";

import Planner from '../Planner/Planner';
import Homepage from '../Home/Homepage';
import Booking from '../Booking/Booking';
import Register from '../Register/Register';
import CusData from '../CusData/CusData';
import Login from '../Login/Login';
import Housing from '../Housing/Housing'

import RootLayout from './Root';
import Errorpage from './Error';
import { createBrowserRouter, RouterProvider, createRoutesFromElements, Route } from 'react-router-dom';
// icon
// import { BiUserCircle } from "react-icons/bi";


const router = createBrowserRouter([
    {
      path: '/',
      element: <RootLayout/>,
      errorElement: <Errorpage/>, 
      children: [
            { path: '/', element: <Homepage />},
            { path: '/Booking', element: <Booking />},
            { path: '/CusData', element: <CusData />},
            { path: '/Housing', element: <Housing />},
            { path: '/Planner', element: <Planner />},
            { path: '/Register', element: <Register />},
            { path: '/Login', element: <Login />}
      ],
    },
    
  ] );
  

const MainNavigation = () =>{
    return (
        
        <header className={classes.header}>
            <nav>
                <ul className={classes.list}>
                    <li>
                        <Link to="/">หน้าหลัก</Link>
                    </li>
                    <li>
                        <Link to="/Booking">การจอง</Link>
                    </li>
                    <li>
                        <Link to="/CusData">ข้อมูลลูกค้า</Link>
                    </li>
                    <li>
                        <Link to="/Housing">โครงการ</Link>
                    </li>
                {/* <li>
                        <Link to="/Login">Login</Link>
                    </li>
                    <li>
                        <Link to="/Register">Register</Link>
                    </li> */}
                </ul>
            </nav>
                     {/* <h3><BiUserCircle size="3rem"/> </h3> */}
        </header>
        
    );
    { router }
}
 
export default MainNavigation;
